          <div className="row">
            <div className="col-sm-6">
              <Explanation lesson={props.lesson}/>
            </div>
            <div className="col-sm-6">
              <p>Try it out!</p>
              <TypesetEx lesson={props.lesson}/>
            </div>
          </div>
          <hr />
          <div style={{ paddingTop: "2%" }}>
            <Test />
          </div>
        </div>
      );
}

export default WholeTutorial
